import React from "react";

export default function Titlebar() {
    return (
        <div className="titlebar">
            <div className="title--title">Movie Recommendation Site</div>
            <div className="Description">
                <div className="firstline">Find out what movies you're into.</div><br />
                <div className="secondline">Search for a movie and discover an entire world of cinema at the palm of your hand.</div>
            </div>
        </div>

    );
}
